def translate(rna):
    protein_list = []
    for i in range(0,len(rna),3):
        protein_list.append(codons[rna[i:i+3]]) 
    protein_string = ""
    for element in protein_list:
        if element != "Stop":
            protein_string += element
    return protein_string


